import React from 'react';
import { Tabs, Tab, TabList, TabPanel } from 'react-tabs';

export default function Navbar() {
  return (
    <React.Fragment>
      <Tabs>
        <TabList>
          <Tab>Home</Tab>
          <Tab>About</Tab>
        </TabList>
      </Tabs>
      <TabPanel>
        <div>Helene Mace</div>
      </TabPanel>
      <TabPanel>
        <div>About goes here</div>
      </TabPanel>
    </React.Fragment>
  )
}
